#define mainImage(f,u)                       				\
    vec2 r = iResolution.xy,                 				\
	     g = u+u-r;                          				\
    g = vec2(log(length(g)/r.y), atan(g.x, g.y) ) * 4.78;	\
	g.x -= iTime;                            				\
	g.y -= iTime * sign(sin(1.57*g.x));      				\
    g = mod(g, 2.) - 1.;                     				\
	g.y *= fract(g.y)-.5;	                 				\
	f += 1. - length(g)

